// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import HandyHomePage from "./Homepage/HandyHomePage";
import Footer from "./components/Footer";
import Header from "./components/Header";
import HandyServicePage from "./ServicesPage/HandyServicePage";
import HomeCleaningPage from "./HomeCleaningPage/HomeCleaningPage";

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HandyHomePage />} />
        <Route path="/Servicepage" element={<HandyServicePage />} />
        <Route path="/Cleaningpage" element={<HomeCleaningPage />} />


        {/* Future pages can be added here */}
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
